import datetime
import calendar

def parse_iso8601(date_str, delimiter='T', timezone=None):
    try:
        date_str = date_str.replace('Z', '+00:00')
        dt = datetime.datetime.strptime(date_str, "%Y-%m-%dT%H:%M:%S%z")
        timestamp = calendar.timegm(dt.utctimetuple())
        return str(timestamp)
    except ValueError:
        return None
